const AddQuote = () => {
    return (
        <div>
            <h3>Add a qong</h3>
            <div>
                <div>
                    <label htmlFor="song">Song name</label>
                    <input type="text" name="song" id="song" />
                </div>

            </div>
            <input type="button" value="Save" />
            
        </div>
    
    );
};


export default AddQuote;
